    [],nt"revision_timestamp": "2016-07-27T22:56:49.393901",nt"name": "2014-black-tailed-prairie-dog-inventory",nt"isopen":
    false,nt"url": null,nt"notes": "The Rocky Mountain Arsenal National Wildlife
    Refuge has designated 2,585 acres of habitat as prairie dog management zones. Following
    native prairie restoration within designated zones, managing the density of prairie
    dogs of 6-10 animals/acre is desired to prevent overutilization of vegetation, ensuring
    the critical long-term sustainability of native vegetation. However, a sufficient
    density of animals should also be maintained to ensure that adequate habitat and
    sufficient prey base is available for resources of concern. The purpose of the black-tailed
    prairie dog inventory is to determine if the management goals and objective of 6-10
    animals/acre are being met according to the Rocky Mountain Arsenal National Wildlife
    Refuge Comprehensive Management Plan and Habitat Management Plan. The results of
    the survey will also be used to determine if the population densities of black-tailed
    prairie dogs are suitable for the reintroduction of black-footed ferrets (Mustela
    nigripes) within the established 2,585 acres of prairie dog management zones. Survey
    methods and data analysis were based on established protocol (Biggins et al 1993).
    In addition, RMANWR staff and the Denver Zoo piloted and tested an alternative to
    Biggins et al. 1993; by conducting a hundred percent inventory of active and inactive
    prairie dog burrows within the management zones (Eads et al 2011). The total prairie
    dog population of all management zones averaged 19.16 PD/ac. Established prairie
    dog management zones exceed the habitat requirements for black-footed ferrets, and
    therefore provide suitable prairie dog populations for approximately 41 female black-footed-ferret
    families [an adult female, her 3.3 (average) young, and 0.5 males].",nt"license_title":
